      <text id="47">
        <text>领域知识：装修设计预约平台
1 客户通过系统预约设计师进行装修设计，客户只能预约一个设计师订单，不能预约多个同时进行设计。
2 预约后，设计师上门进行量房，根据面积进行报价和预估设计时间。设计师订单按照4个节点预估交付时间，在不同节点交付不同成果，这四个节点分别为平面图、效果图、施工
图、交底，四个节点的付款比率分别为10%、40%、40%、10%。
3 客户接受报价方案后，进行付款，设计师开始设计；如果拒绝，则设计师可以进行再次报价和预估设计时间。
4 客户在付款之前，都可以进行终止。
5 客户付款后，正式进入设计阶段。设计师按阶段推进设计并按阶段更新进度。在每一个阶段，设计师完成任务后，客户进行阶段成果确认，客户确定后所有阶段后，订单自动完成。
6 客户可以对完成的订单进行评价。
7 客户对已付款但未完成的订单可以提出退款申请，退款计算方法依据当前设计进度，如果当前进度已经达到设计师请求施工图设计确认进度或超过该进度，则不允许退款。如果允
许退款，退款金额最多为（总额 - 已完成的各阶段付款之和），最少为未完成交付节点的待付款总额。
8 申请通过的退款订单不再允许更新进度。</text>
      </text>

      <text id="129">
        <text>设计师订单规则
1 只有已经付款的订单，并且设计进度没有超过施工图请求确认阶段的订单可以申请退款。
2 设计师每完成一个阶段便会提交进度更新请求。
3 退款金额按照完成进度进行计算。
4 如果设计师更新进度、客户提交退款申请同时发生，会发生冲突。
5 整个设计师订单的一致性通过聚合根进行整体维护，确保退款和更新进度只会发生一次。
没有聚合根的冲突
1 客户查看当前进度，然后退款中，并且计算金额。
2 设计师根据订单状况，提交进度。</text>
